import React from "react";
import styled from "styled-components";
import tw from "twin.macro";
import { Marginer } from "../../components/marginer";
import { NavBar } from "../../components/navbarHomepage";
import { TopSection } from "./topSection";
import { Services } from "../Resurrect/services";
import { Footer } from "../../components/footer";
import algosdk from "algosdk";

const header = {
    'X-API-Key': '6RteTejPCj99qAIeQTlFb4nnsCrnDFXp9emi1dtO'
}
const token = ''

const indexerClient = new algosdk.Indexer(token, 'https://mainnet-algorand.api.purestake.io/idx2', header)


const PageContainer = styled.div `
    min-height:800px;
    ${tw`
        flex
        flex-col
        w-full
        h-full
        items-center
        overflow-x-hidden
    `}
`;



export function Resurrect(props) {
    return (   
            <PageContainer>
                <NavBar />
                <Marginer direction="vertical" margin="2em" />
                <TopSection />
                <Marginer direction="vertical" margin="20em" />
                <Footer />
            </PageContainer>
    );
}
